function linking_constraints_testing(; solver = nothing)
    m = JuMP.Model(solver)
    
    x_Idx = Any[1, 2, 3, 4]
    @variable(m, 0 <= x[x_Idx] <= 1) 
    @variable(m, obj)
    @objective(m, Min, obj)
    @NLconstraint(m, e1, -(0.4931*x[1]*x[2] + 
                           0.6864*x[1]*x[3] - 
                           0.0577*x[1]*x[4] + 
                           0.3468*x[1]*x[2]*x[3] - 
                           0.6988*x[1]*x[3]*x[4] - 
                           0.9648*x[1]*x[2]*x[4]) + obj == 0.0)
 
    return m
 end

